import { Link } from 'react-router-dom'

function Footer() {
    return (
        <div className='footer'>
            <Link to="/about">About</Link>
            <Link to="/projects">Projects</Link>
            <Link to="/cv">CV</Link>
        </div>  
    )
}

export default Footer
